"announcement": "Welcome to our shop. We highly recommend purchase a Fabric Swatch listing while deciding the best colors for your space.\r\n\r\n$3.00 pays for 3 swatches. https://www.etsy.com/listing/99182010/swatch-request?ref=shop_home_active\r\n\r\nOur return policy includes (1 week from receiving package) and a deduction of 30% from the total for all returned item(s) due to the fact that each pillow cover is made to order and the labor has been sewn and constructed by myself or someone in our team. The remaining payment will be refunded to you once I have the item(s) back in my possession for review.\r\n\r\nHappy Shopping!\r\n\r\nCreate a New and Fresh look in your space this year by treating yourself to a Motif Pillow Cover! Please enjoy Free U.S. Shipping with coupon code Ship4free!\r\n\r\n The current lead time is 7 - 10 BUSINESS days (2 weeks) on all items.\r\n\r\n/////////////////////////////////////////////////////////\r\n\r\n I am a proud member of the Interior Design Society and have a passion for beautiful textiles. It is my goal to bring high end trends and whimsical treats to you, via pillow covers.  All pillow covers are made to order. Please look over the shop Policy section before finalizing your purchase!\r\n\r\nPriscilla\r\n\r\n **  I appreciate the questions on what fabrics I use. At this time I can only answer questions for customers and potential pillow cover orders. The fabrics used are not for sale.\r\n\r\n/////////////////////////////////////////////////////////\r\n\r\nFor coupon codes and give aways:\r\nInstagram: @motifpillows #motifpillows \r\nFacebook: www.facebook.com/MotifPillows\r\nPinterest: www.pinterest.com/motifpillows/\r\nWebsite: www.MotifPillows.com",
"currency_code": "USD",
"is_vacation": false,
"vacation_message": "Thank you for visiting Motif Pillows! THE SHOP IS CLOSED due to a large amount of orders needed by Christmas. We will reopen December 15th. Orders placed after December 16th will Arrive AFTER Christmas. Orders placed on Dec. 16th can not be rushed.  If you are looking for the ship date it is on the top right side of your emailed invoice/confirmation of sale from Etsy. Please refer to your shipping date on the emailed invoice. The shop will re open Monday, December 15th!  \r\n\r\nPriscilla \r\n",
"sale_message": "Your order will ship 7 - 10 BUSINESS Days! TWO week turn around!\r\n\r\n************************************************************************************************\r\n\r\nPlease read below:\r\n\r\nThank you so much for your purchase!\r\n\r\n***If you need your order sooner them 10 BUSINESS DAYS it is an extra cost; please send me a message to pay the upgrade production rush fee\r\n\r\nUS Orders ship 2- 3 Day USPS Priority after the 7-10 Business Day Turn around is complete.\r\n\r\n* USPS Shipping Tracking Confirmation Number will be sent via an Etsy Message to your Etsy Inbox.\r\n\r\n** International packages are due to arrive with in 10-20 business days, once the packages have shipped. They are all shipped First-Class Package International Service via USPS.  ** Convo me if you would like to upgrade your International Shipping.\r\n\r\n All pillows are made to order. I do my best to ship them out as soon as I can while sewing full time 6 days a week.  Your purchase(s) will be worth the wait! \r\n\r\nIf you have any questions or concerns please feel free to contact me, I am always happy to help!\r\n\r\n~ Priscilla\r\n\r\nYour pillow will be sewn the size that you have purchased (inside measurements).\r\n\r\nI recommend that you fill your pillow cover with a down pillow form that is 2 inches large than the finished measurement to fill out the corners. \r\n\r\nIf you would like the size to be custom please let me know and I will make it as desired (whether snug or loose).\r\n\r\n\r\nRETURNS: \r\nThere is a restocking fee  of 30% deducted from the total -  for any returned item(s). This is due to the fact that each pillow cover is made to order and the labor has been sewn and constructed by myself or someone in our team. The remanding payment will be refunded to you once I have the item(s) back in my possession for review.\r\n\r\n**If you have received the swatch and than place an order for pillow covers there are no returns because the swatch was approved.\r\n\r\nPlease message directly me with any concerns. Please contact me so that I can best help the situation! \r\n\r\nCANCELLATIONS are only accepted within 48 hours of your purchase. ",
"digital_sale_message": "Your order will ship 7 - 10 BUSINESS Days (Two Weeks)! Please read below:\r\n\r\nThank you so much for your purchase! (If you need your order sooner them 10 BUSINESS DAYS it is an extra cost; please send me a message)\r\n\r\nUS Orders ship 2- 3 Day USPS Priority after the 7-10 Business Day Turn around is complete.\r\n\r\n* USPS Shipping Tracking Confirmation Number will be sent via an Etsy Message to your Etsy Inbox.\r\n\r\n** International packages are due to arrive with in 10-20 business days, once the packages have shipped. They are all shipped First-Class Package International Service via USPS.  ** Convo me if you would like to upgrade your International Shipping.\r\n\r\n All pillows are made to order. I do my best to ship them out as soon as I can while sewing full time 6 days a week.  Your purchase(s) will be worth the wait! \r\n\r\nIf you have any questions or concerns please feel free to contact me, I am always happy to help!\r\n\r\n~ Priscilla\r\n\r\nYour pillow will be sewn the size that you have purchased (inside measurements).\r\n\r\nI recommend that you fill your pillow cover with a down pillow form that is 2 inches large than the finished measurement to fill out the corners. \r\n\r\nIf you would like the size to be custom please let me know and I will make it as desired (whether snug or loose).\r\n\r\nRETURNS: \r\nThere is a restocking fee  of 30% deducted from the total -  for any returned item(s). This is due to the fact that each pillow cover is made to order and the labor has been sewn and constructed by myself or someone in our team. The remanding payment will be refunded to you once I have the item(s) back in my possession for review.\r\n\r\n**If you have received the swatch and than place an order for pillow covers there are no returns because the swatch was approved.\r\n\r\nPlease message directly me with any concerns. Please contact me so that I can best help the situation! \r\n\r\nCANCELATIONS are only accepted within 48 hours of your purchase. ",
