"policy_welcome": "Thank you for visiting Motif Pillows!  My goal is to make the pillows you love at an affordable price. To create an environment of having a variety of pillows to mix and match our changing flare, trends, and style .\r\n\r\nThere’s a lot of attention and love in every pillow. Every pillow is handmade and durable, surged (professionally stitched) with designer fabrics. We make sure to take care of all the details; Motif Pillows are enclosed with a hidden zipper. \r\n\r\nPillows are sewn to the exact size that you are purchasing.  I recommend using a down insert that is 2&quot; bigger for a nice cozy and snug fit, for covers 18&quot; and larger.\r\n\r\nPillows are ironed and starched before shipment but will need light ironing once they arrive to your home.\r\n\r\nCare:  Dry Cleaning is recommended. Please Iron or Press your pillow covers inside out!\r\n\r\nAll pillows are sewn in a smoke free, dog free and cat free environment .",
"policy_payment": "Visa, Mastercard, American Express, Discover & regular Paypal payments are all accepted forms of payment. Etsy gift cards are also excepted.\r\n\r\nBy law we must charge in state sales tax only. South Carolina will be charged 6% sales tax. \r\n",
"policy_shipping": "Item(s) WILL BE SHIPPED WITH IN 7-10 BUSINESS DAYS FROM PURCHASE\r\nPlease contact me about rush orders there is an additional fee.\r\n\r\nItem(s) will ship via USPS first class mail or priority mail.\r\n\r\nPlease be sure your Etsy and pay pal shipping addresses match. In the case of non-matching address pay pal is used as the default shipping address, I can not be held responsible if the address on file with pay pal is incorrect.\r\n\r\nPlease be sure your address is correct, shipments returned for an incorrect address will be re-shipped at buyers expense.\r\n\r\nPay pal DOES allow you to enter a different ship to address.\r\nIf you would like the item to ship elsewhere such as a work address or to someone else as a gift please indicate that in the message to seller box on Etsy and pay pal.\r\n* USPS Shipping Tracking Confirmation Number will be sent via an Etsy Email.\r\n\r\n** International packages are due to arrive with in 10-20 business days, once the packages have shipped. They are all shipped First-Class Package International Service via USPS.  \r\n\r\nInternational Orders will be marked merchandise and not gift. \r\n\r\nPLEASE NOTE:\r\nAll local taxes and customs duty, if applicable is payable by the buyer",
"policy_refunds": "Each listing description has a direct link to our return policy - Thank you for taking the time to read our policy. Because the link to the shop policies is on each pillow cover description we hold all customers responsible to read the below information. \r\n\r\nThanks,\r\n\r\nPriscilla \r\n\r\nI highly recommend purchase a Fabric Swatch listing. $3.00 pays for 3 swatches. https://www.etsy.com/listing/99182010/swatch-request?ref=shop_home_active\r\n\r\nThere is a restocking of 30% fee deduction from the total for any returned item(s) due to the fact that each pillow cover is made to order and the labor has been sewn and constructed by myself or someone in our team. The remanding payment will be refunded to you once I have the item(s) back in my possession for review.\r\n\r\n**If you have received the swatch and than place an order for pillow covers there are no returns because the swatch was approved.\r\n\r\nPlease message directly me with any concerns. Please contact me so that I can best help the situation! \r\n\r\n**Special Orders and Custom Sizes are non refundable**\r\n\r\nCANCELLATIONS are only accepted within 48 hours of purchase. \r\nSIZE CHANGES need to be communicated and confirmed within 48 hours of purchase.\r\n",
"policy_additional": "SEWN MEASUREMENTS:\r\n\r\nMotif pillows are measured from seam to seam with a soft measuring tape on the INSIDE of each pillow cover. They are NOT measured outside corner to corner. If measured corner to corner down the side, you will be short .5&quot; to an 1&quot; depending on the stretch of the fabric. We confirm our pillow cover sizes while sewing and before shipment to insure accuracy. If you have any questions about sizing please message me! \r\n\r\nWashing and Ironing Policy: \r\n\r\nI highly suggest dry cleaning for most home decor fabrics vs. spot cleaning. All pillow covers should be ironed inside-out to assure that the fabric is not burned/singed or stained.",
