"description": "Burlap gift bottle bag with floral garland of orange and cream roses and a heart shape slate tag. Can be personalized.\n\nA rustic style brown burlap wine gift bag with a Rose garland in Cream and Oranges and wine cork decorations and a black slate Heart shaped tag which can be personalized.\n\nWine bottle gift bag measures approximately 28 cm x 38 cm ( size may vary slightly ).\n\nMade from natural brown hessian, to fit a variety of sizes of glass bottles.\n\nThese hessian bags are fully reusable and can be sponge cleaned and air dried.\n\nNot suitable for children&#39;s drink bottles.\n\nUsed for gift wrapping Wine, Champagne, Whiskey, Vodka, Gin, Rum.\n\nGift bag comes in kit form, once the wine bottle is placed into the hessian sack, simply tie the jute twine around the neck and wrap the floral garland around.\n\nPerfect to give as a birthday or wedding gift with a bottle of Champagne inside.\n\nWould also make a stylish Hostess gift with a bottle of wine.\n\nPlease message me with your desired personalization if you require this.\n\nThis item comes gift wrapped courtesy of SCW Vintage and is ready to post within 2 working days.\n\nTo view more bottle bags & gifts available please visit my shop https://www.etsy.com/uk/shop/SCWVintage\n\nYou can view our shop reviews here https://www.etsy.com/uk/shop/SCWVintage?ref=hdr_shop_menu#reviews",
