"accepts_custom_requests": true,
"policy_welcome": "Welcome to Princess Bead Supply!   We offer the highest quality  silicone beads, teethers, chunky beads, mini beads and boutique supplies! \r\n\r\nWe love our customers! ❤️ Here are some coupon codes just to say &quot;Thank you&quot; for shopping with us! 😊\r\n\r\nSave 5% off orders equal or above $50 Coupon Code: SAVEBIG5\r\nFree shipping on orders over $75 Coupon Code: FREESHIP75 (US ONLY)\r\n\r\nFree shipping is not available for international orders. International customers can save $5 on orders over $75. Coupon Code: WORLDWIDE\r\n\r\nSave 10% off orders equal or above $100 Coupon Code: SAVEBIG10\r\nSave 15% off orders equal or above $200 Coupon Code: SAVEBIG15\r\nSave 20% off orders equal or above $500 Coupon Code: SAVEBIG20\r\n\r\n\r\nLimit one coupon code per order. So pick which discount code can help you save the most! Coupon code must be applied at the time of purchase! Coupons cannot be applied to past purchases. \r\n\r\nAll orders ship SAME/NEXT day!   We ship fast!  😊  We know our supplies are important to your business and do it yourself projects!  All orders are treated with priority and shipped out as quickly as possible!    Priority shipping upgrades are available during checkout.   \r\n\r\n Out of Stock/Back Ordered Items:\r\n    We try to keep all items in stock!  If any item sells out we will contact you before your order is shipped! You will be given the option to be refunded for out of stock items, or the option to switch out colors or products, or the option to have your item(s) shipped when it is back in stock at no additional charge!\r\n\r\nSilicone Beads & Teethers:\r\n   * 100% Non-Toxic\r\n   * Lead Free\r\n   * BPA Free\r\n   * Cadmium Free\r\n   * Mercury Free\r\n   * Phthalate Free\r\n   * Approved by the FDA, CCPSA approved, LFGB approved, SGS approved\r\n   * CPSIA approved.\r\n   * ASTM International Certification\r\n   * CE Certification\r\n\r\nSafety Certificates are available upon request.   Just message me once you have placed your order and I can forward them to you!    \r\n\r\nCustom and wholesale orders are always welcome!  Feel free to contact me if you are looking for something special!  I can always set up a custom listing for you!  \r\n\r\nPlease remember that loose beads and/or small parts can pose choking hazards. Children should never be left unattended with loose beads!   And as always, please inspect all products before use.  If damaged in any way discontinue using and discard of immediately.\r\n\r\n\r\nThank you!!!   ",
"policy_payment": "Princess Bead Supply accepts credit and debit cards through Paypal, Etsy gift cards, and credit or debit cards payments directly though Etsy.  ",
"policy_shipping": "All items are shipped out via USPS. \r\n\r\nWe offer some of the fastest shipping on Etsy!   All items are usually shipped out the next business day!  \r\n\r\nPlease be aware that once your package is mailed I cannot be held responsible for it.  If you would like to add insurance to your package to protect it against loss or damage, please let me know and I will send you an invoice for the additional fee.  Please note that packages shipped via Priority mail includes insurance for up to $50.  \r\n",
"policy_refunds": "All items include a detailed description, so please take the time to read this before you order.   Please contact me if you have any questions or need more information about an item.  \r\n\r\nWe gladly accept returns, exchanges or cancellations.  Just contact me within 3 days of delivery if you need to return or exchange something.   Items must to be returned in original condition within 15 days of delivery.  Original shipping fees are not refundable.  Buyer is responsible for return shipping costs.  Order cancellations request must be made within one hour of purchase.  \r\n\r\nI will not be able to offer a refund when an item is damaged or lost in transit.  A claim with the postal service will have to filed.  All items are shipped USPS with delivery confirmation.  ",
"policy_additional": "Please note that loose beads and other small craft supplies can cause choking hazards.  Please never leave your children unattended with these items!",
