"title": "Gilded Peach Inspired Studio",
"announcement": "LIKE our Facebook page and JOIN our mailing list to get special offers and discounts! \r\n\r\nWELCOME to Gilded Peach Artisan jewelry&#39;s online boutique, operating out of gorgeous Key West, FL. Thank you so much for visiting!! If you are in Key West, come visit my studio and showroom at 1114B Truman Avenue!\r\n\r\nGilded Peach Jewelry is also available at 6 locations (besides my studio) in Key West, and online at http://gildedpeach.etsy.com/!\r\n* Wanderlust, 310 Petronia Street\r\n* Rubies & Clay, 529 Whitehead Street\r\n* Ocean Key House Resort, Zero Duval Street\r\n* Isle Style, 1204 Simonton Street\r\n* Shakti Yoga and Juice Bar, 1114 White Street\r\n* Key West Sunshine Club, 220 Petronia Street\r\n\r\nEach Gilded Peach design is created with the intention of making its wearer feel beautiful. With a definition of beauty that varies with each person, you can be assured that we create a variety of styles and designs that spans the spectrum. Gilded Peach jewelry brings you the colors and shapes of nature, harmonizing with impeccable style and a touch of fun. \r\n\r\n\r\n***also please visit www.gildedpeach.com***\r\n\r\nI ship within 48 hours of receiving your paypal payment, unless you receive an email from me.\r\n\r\nIF YOU ARE IN THE LOWER KEYS--- please use the coupon code KEYWEST when checking out, to avoid being charged for shipping. I will deliver. Thanks!",
"currency_code": "USD",
