"vacation_message": "Hello and thank you for visiting! I have put my shop on vacation while Key West is in high season- I can&#39;t keep up with my shop and the website! Hope to have plenty more for you to enjoy soon- keep checking!",
"sale_message": "Thanks for buying a piece from me! I will ship via USPS within 48hours of receiving your paypal payment (usually sooner).  =)",
