"login_name": "prunuspersica",
"accepts_custom_requests": true,
"policy_welcome": "Welcome to Gilded Peach Artisan Jewelry! We thank you for finding us and hope you love what you see.\r\n\r\nPhilosophy\r\n     Each Gilded Peach design is created with the intention of making its wearer feel beautiful. With a definition of beauty that varies with each person, you can be assured that we create a variety of styles and designs that spans the spectrum. Gilded Peach jewelry brings you the colors and shapes of nature, harmonizing with impeccable style and a touch of fun. \r\n\r\nIf you need help with your first purchase on Etsy, Here is a helpful guide:\r\nhttp://www.etsy.com/help/article/339",
"policy_payment": "We accept Paypal (you can pay with a credit card using Paypal without opening an account - see above link), money orders, and checks. Money orders, personal checks, must clear ( 6-10 business days) before your order is shipped.",
"policy_shipping": "I ship domestically via USPS, which generally will reach you within 3-4 business days (and they also deliver on Saturday). I will ship within 48 hours of receiving your paypal payment, usually sooner, and 24 hours of your check or money order clearing.    **Shipping charges DO NOT include insurance, however we highly recommend it. If you would like your parcel insured please contact us so we can send an adjusted invoice reflecting the insurance. \r\n\r\nI charge a $30 flat rate for international orders, and may charge more depending on the rate I receive. I will bill for that with an email invoice after we have communicated.",
"policy_refunds": "Returns are accepted within 5 days of receiving your purchase. The item must be returned in new and unused condition. Please contact us if you are unhappy with your purchase. Unless an item has been damaged in transit, we do not issue refunds. STORE CREDIT ONLY. \n\n\nNo refunds on custom orders.\r\n",
"policy_additional": "CARE OF YOUR FINE GEMSTONE JEWELRY:\r\n\r\nPlease do not submerge your Gilded Peach jewelry in cleaning solutions. The proper way to polish your jewelry is to buff the metal surfaces with an appropriately treated silver or gold metal cloth. Gemstones can be buffed to a shine using a soft, non-abrasive cotton or satin cloth. Please remember, artisan made jewelry is not the same &quot;cookie-cutter&quot;, mass produced jewelry you will find in retail chain stores. You are purchasing unique, handmade designs and they require a little extra care and attention. If possible, store your jewelry in the box you received it in to keep your jewelry safe from the environment which can tarnish silver and weaken metal components over the years, particularly if left out in a humid environment. Care for your precious gemstone jewelry and you will enjoy it for many generations to come! ",
