"title": "Choice of Morganite, Sunstone, Citrine, or Hessonite Garnet Pendant in Rose or Yellow Gold, 9 x 7 mm",
"description": "This made-to-order pendant can hold either a faceted morganite, sunstone, citrine, or hessonite garnet in an 18K rose gold-plated over sterling silver or 14K yellow gold-filled pendant setting. \n\nFrom left to right:\n1. Brazilian Morganite - 9 x 6.9 mm\n2. Tanzanian Sunstone - 9.2 x 7 mm\n3. Brazilian Citrine - 9.2 x 7.3 mm\n4. Hessonite Garnet - 9.9 x 6.9 mm\n\nGemstone information is below.\n\nChain not included (to keep prices lower for you), but if you need one, I have a variety for sale at: https://www.etsy.com/listing/192336971/chains-in-silver-yellow-rose-gold\n\nMorganite is a pink type of beryl (emerald family), named after J.P. Morgan, an avid gem collector. The color ranges from very light pink, looking nearly colorless, to peach and rose pink. It is the second-rarest color in the beryl family, second only to bixbite. It is found in a few places around the world, including Brazil, Madagascar, Mozambique, Afghanistan, Pakistan, among others. \n\nhttp://en.wikipedia.org/wiki/Beryl\n\nSunstone is a type of feldspar that shimmers and sparkles when viewed from different directions, an effect called shiller. Common sources are Norway, Siberia, and many USA locations. Oregon sunstone contains copper inclusions, producing golden, copper, and green coloring. \n\nSunstone is the official gemstone of Oregon.\n\nhttp://en.wikipedia.org/wiki/Sunstone\n\nCitrine is a color of quartz, showing yellow to gold or brown colors. It&#39;s mostly mined in Brazil, and often found paired with amethyst, creating ametrine. It is often heat treated to enhance color.\n\nCitrine is linked to the planet Mercury, and also sometimes considered a birthstone of November, as it is often interchanged with topaz.\n\nhttp://en.wikipedia.org/wiki/Quartz\n\nThe use of garnets as gemstones dates back thousands of years, used by Egyptian pharaohs, ancient Greeks and Romans in jewelry. It is even said that Noah used a garnet lantern to light the way for his ark. Garnet is known as the traveler&#39;s stone, having been carried as a talisman for protection and to light the traveler&#39;s path. There are over twenty varieties of garnets, but six types are used for gemstones: pyrope, almandite, spessartite, grossularite, andradite, and uvarovite.\n\nHessonite garnet is a red, orange, or yellow type of the grossular garnet family, that typically comes from Sri Lanka and India. It&#39;s often been called &quot;cinnamon stone&quot; due to its color. Imperial hessonite garnet is a golden type of hessonite garnet colored by iron. \n\nGarnet is the birthstone of January, and comes in every color. It is also the zodiacal stone of Aquarius and is the 2nd anniversary stone. It is the state gemstone of Connecticut and New York, and star garnet is the gemstone of Idaho.\n\nhttp://en.wikipedia.org/wiki/Garnet\n\nInsurance and tracking is included in the shipping price for US addresses on account of the item&#39;s value, but if you&#39;d like insurance/tracking on international shipping, please contact me first. Rates will vary depending on your location.",
