"title": "Magnolia Wreath Co.",
"announcement": " Magnolia Wreath Co. specializes in romantic, vintage, rustic, shabby chic and my namesake magnolia wreaths for home, weddings, nurseries and holidays. I use the highest quality materials to insure that you are receiving a spectacular arrangement for your home.\r\n\r\nIt all started in the early nineties when I owned a floral business specializing in dried flower arrangements. And, for as long as I can remember, I have loved working with my hands whether sewing, landscaping, or floral designing. The creative process and end results have always brought me joy – I feel a great satisfaction to sit back and see what I have created. \r\n\r\nWhen I design with flowers I place all the flowers and greenery together and play with it until I get the right proportions, angles and color combinations and just the right amount of flowers to greenery.   I then permanently secure the arrangement to the grapevine wreath.\r\n\r\nI tend to focus on my favorite themes, which include shabby chic, vintage, cottage and rustic (romantic). Each one of my wreaths will tell a story whether it is marking the entrance to a chapel, front door, wedding, or just something pretty over a fireplace or bed. \r\n\r\nI love what my hands can create and am honored when you choose to adorn your home with my work.  My wish is that it will bring you as much joy as it did for me to create.\r\n",
