"title": "Double Orange-Red Velvet Rose Hair Flower",
"description": "A double rustic red-orange velvet rose Hair flower  with a crocodile clip fastening.\n\nPerfect for that Vintage, Pin Up or Rockabilly inspired outfit! \n\nAll of our clips are made with a flat, concealed crocodile clips appropriate for the flower size so that all flowers sit securely and comfortably to your head.\n\nI often have more Hair Flowers than I have time to list, so please feel free to contact me if you cannot find what you are looking for.\n\nWe offer a bespoke design service, please ask!\n\nAll Rockabilly Red creations are made to order, so please contact me for any variations that you may wish and we will create something especially for you! \n\nCreation time is between 1-2 weeks including postage but urgent orders are welcomed upon conversation first. Please bear in mind that slight variations may occur on custom made items.\n\nFor deliveries outside of the UK, please contact us and we will create a listing especially for you.\r\n\r\nWe are a small independent business and really value your custom. Please contact us with any queries. If there is ever a problem we will do our utmost to fix it. Feedback/a review is always gratefully received.\n\nThank you so much for looking!\n\nXxx",
